def bubble_sort(words):
    n = len(words)
    for i in range(n): 
        # Last i elements are already in place 
        for j in range(0, n-i-1): 
            if words[j] > words[j+1]: 
                words[j], words[j+1] = words[j+1], words[j]
    return words

