function addIntWithoutTypeConversion(a, b) {
  let sum = 0;
  let carryin = 0;
  let k = 0;
  let temp_a = a;
  let temp_b = b;

  while (k < 32) {
    let ak = a >> k & 1;
    let bk = b >> k & 1;
    let carryout = (ak & bk) | (ak & carryin) | (bk & carryin);
    sum |= (ak ^ bk ^ carryin) << k;
    carryin = carryout << 1;
    k++;
  }

  return sum;
}

