function flattenKeys(obj) {
 let flattened = {};
 for (let key in obj) {
 if (typeof obj[key] === 'object') {
 for (let subkey in obj[key]) {
 flattened[`${key}_${subkey}`] = obj[key][subkey];
 }
 } else {
 flattened[key] = obj[key];
 }
 }
 return flattened;
}

