public static String reverseString(String s) {
  char[] arr = s.toCharArray();
  int n = arr.length;

  for (int i = 0; i < n/2; i++) {
    char temp = arr[i];
    arr[i] = arr[n-i-1];
    arr[n-i-1] = temp;
  }
  return new String(arr);
}

function isPrime(n) {
    if (n === 2) return true;
    if (n % 2 === 0) return false;
    for (let i = 3; i <= Math.sqrt(n); i += 2) {
        if (n % i === 0) return false;
    }
    return true;
}
