def reorder_dict(d):
    sorted_dict = {}
    sorted_values = sorted(d.values())

    while sorted_values:
        key = sorted(d, key=lambda k: d[k] == sorted_values[0])[0]
        sorted_dict[key] = d[key]
        sorted_values.remove(d[key])

    return sorted_dict

