float square_root(float number){
    float low = 0;
    float high = number;
    float mid;

    while (low <= high){
        mid = (low + high) / 2;
        if (mid * mid == number){
            return mid;
        }
        else if (mid * mid > number){
            high = mid;
        }
        else {
            low = mid;
        }
    }
    return -1;
}

